[TimePicker] allow set time to null

When try to set time picker back to `null` it raise error `getHours undefined in null` so now i need to make custom hack:

```
  resetTime(){
    const emptyTime = new Date();
    emptyTime.setHours(0);
    emptyTime.setMinutes(0);
    emptyTime.setSeconds(0);
    emptyTime.setMilliseconds(0);

    this.refs.time.setState({
      time: emptyTime
    });
    this.refs.time.refs.input.setValue(null);
  }
```

Added `textTransform` theme-level key for buttons

Now, `textTransform` can be applied to all buttons (both `FlatButton` and `RaisedButton`), only `FlatButton`, or only `RaisedButton` on a theme-level.

Here is how:

```js
let newMuiTheme = ThemeManager.getMuiTheme(LightRawTheme);

//override theme variable for button
//this override will apply to both FlatButton and RaisedButton
newMuiTheme.button.textTransform = 'none';
```

```js
let newMuiTheme = ThemeManager.getMuiTheme(LightRawTheme);

//override theme variable for only RaisedButton or FlatButton (substitute accordingly)
newMuiTheme.raisedButton.textTransform = 'none';
```

`textTransform` corresponds to the CSS `text-transform` property and can take any valid value that the CSS property can take.

Related to callemall/material-ui#1576

Add #isOpen method to IconMenu

Adds an isOpen method to an iconMenu. 

The way I'm using this is that I am programmatically opening / closing the menu from a different user action.

```jsx
  _toggleMenuState = () => {
    let isOpen = this.refs.menu.isOpen();
    // weird bug https://github.com/callemall/material-ui/issues/1254
    setTimeout(() => {
      if (isOpen) {
        this.refs.menu.close()
      } else {
        this.refs.menu.open()
      }
    }, 1);
  }
```
There is actually a related bug here: https://github.com/callemall/material-ui/issues/1254 to make this work.

